pragma solidity ^0.4.24;

import "./Type.sol";

contract User {
  mapping(address => Profile) public users;
  mapping(address => uint) public userId;
  mapping(bytes32 => uint) public emailId;
  uint public usersCount;

  struct Profile {
    address id;
    string email;
    uint since;
  }

  constructor () public {
    // loginUser("C1");
  }

  function verifyCredentials(bytes32 _email) public view returns (bool, bool) {
    uint _userId = userId[msg.sender];
    uint _emailId = emailId[_email];

    if ((_userId != 0 && _emailId == 0) ||
       (_userId == 0 && _emailId != 0)) {
      return (false, false);
    }
    if (_userId != 0 && _emailId != 0) {
      return (true, true);
    }
    return (true, false);
  }

  function loginUser(bytes32 _email) public {
    usersCount++;
    userId[msg.sender] = usersCount;
    emailId[_email] = usersCount;
    users[msg.sender] = Profile({
      id: msg.sender,
      email: Type.bytes32ToStr(_email),
      since: now
    });
  }
}
